import React from 'react';
import '../styles/OurProcess.css';

function OurProcess() {
  return (
    <section className="our-process">
      <h2>Our Process</h2>
      <ol className="steps">
        <li><strong>Step 1:</strong> Initial consultation to understand your situation</li>
        <li><strong>Step 2:</strong> Document gathering and eligibility analysis</li>
        <li><strong>Step 3:</strong> Recovery and planning strategy presentation</li>
        <li><strong>Step 4:</strong> Secure recovery filing and results delivery</li>
      </ol>
    </section>
  );
}

export default OurProcess;
